here's one thing that pisses me off, it's when mistakes are made. In this case, Kink's talent department led Iona Grace to think she was just stopping by for a simple camera show, when in fact she was booked for one of my scenes.

Iona, fresh from a vacation, was not ready for the shit storm that rained down on her. Grabbing her from the webcam waiting room, I dragged her down the hall to where Lorelei Lee and I set up our shoot. While she had performed for the now-dormant Wired Pussy, she didn't know about and never shot for Electrosluts.

With cattle prods, the violet wand, the zapper, sticky pads, an electric anal plug, the Hitachi Magic Wand and a fist, Lorelei and I introduce Iona to Electrosluts, and show her that though we still play with electricity, it's a whole new show.
